function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://assets.aboutamazon.com/dims4/default/c9f9236/2147483647/strip/true/crop/1279x720+1+0/resize/2640x1486!/format/webp/quality/90/?url=https%3A%2F%2Famazon-blogs-brightspot.s3.amazonaws.com%2F77%2F09%2Fcd428ca04437b8ecf6e172e2233f%2Fweb-banner.jpg"
        alt="banner"
      />
    </div>
  );
}

export default Home;
